import { combineReducers } from 'redux';
import filterReducer from './filters';
import pizzasReducer from './pizzas';
import cart from './cart';

const rootReducer = combineReducers({
  filterReducer,
  pizzasReducer,
  cart,
});

export default rootReducer;
